import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Member } from 'src/app/entity/member';
import { MemberService } from 'src/app/services/member.service';

@Component({
  selector: 'app-show-member',
  templateUrl: './show-member.component.html',
  styleUrls: ['./show-member.component.css']
})
export class ShowMemberComponent {

  memberData: Member[] = [];

  constructor(private adminMemberService: MemberService, a private activeRoute : ActivatedRoute) { }
   adminEmail= ""

  ngOnInit(): void { 
    this.activeRoute.paramMap.subscribe((param) => {
      this.adminEmail = String(param.get('name'));
    });
    if (this.adminEmail.length <= 0) {
      alert("Your Are not Known to me <br> login as admin")

     }
    else{
      this.adminMemberService.getAllMember().subscribe({
        next:(value)=>{
          this.memberData = value
          console.log(value)
        },
        error:(err)=>{
          console.log(err)
        },
      })
    }
  }

}
